    border-radius: 100%;
  }

  /******** Firefox ********/
  input[type="range"].sliderInput::-moz-range-thumb {
    outline: 3px solid theme('colors.teal-accent');
    background-color: theme('colors.teal-accent');
    outline-offset: 0.125rem;
